import React from 'react';
import {motion} from 'framer-motion'
import { fadeIn } from '../variants';


const Contact = () => {
  return(
   <section className="py-16 lg:section " id="contact">
   <div className="container mx-auto">
   <div className="flex flex-col lg:flex-row">
   <div className="flex-1">
   <div>
   <h4 className="text-xl uppercase text-accent font-medium mb-2
   tracking-wide">Get in touch
   </h4>
   <h2 className='text-[45px] lg:text-[90px] leading-none mb-12'>Let's work <br/> together!
   </h2>
   </div>
   </div>
   <form className="flex-1">
    <input className='bg-transparent' type='text' />
   </form>
   </div>
   </div>
   </section>);
};

export default Contact;
